--CREATING TABLE 
CREATE TABLE CUSTOMER (
    CUST_ID INT PRIMARY KEY,
    CUST_NAME VARCHAR(100) NOT NULL,
    ACCOUNT_TYPE VARCHAR(50),
    BALANCE NUMERIC(12, 2),
    BANK_ID INT,
    FOREIGN KEY (BANK_ID) REFERENCES BANK(BANK_ID)
);
